class Solution(object):
    def findRestaurant(self, list1, list2):
        """
        :type list1: List[str]
        :type list2: List[str]
        :rtype: List[str]
        """
        l1_index = {u: i for i, u in enumerate(list1)}
        best, ans = 1e9, []
        for j, v in enumerate(list2):
            i = l1_index.get(v, 1e9)
            if i + j < best:
                best = i + j
                ans = [v]
            elif i + j == best:
                ans.append(v)
        return ans

    def findRestaurant1(self, list1, list2):
        """
        :type list1: List[str]
        :type list2: List[str]
        :rtype: List[str]
        """
        l = len(list1) + len(list2)
        for tl in range(1, l):
            result = []
            for j in range(0, tl):
                if j < len(list1) and tl - j - 1 < len(list2) and tl - j - 1 >= 0 and list1[j] == list2[tl - j - 1] and list1[j] not in result:
                    result.append(list1[j])
                if j < len(list2) and tl - j - 1 < len(list1) and tl - j - 1 >= 0 and list2[j] == list1[tl - j - 1] and list2[j] not in result:
                    result.append(list2[j])
            if result != []:
                return result
        return -1

